seo_textdata.type:  path: '/admin/seo_textdata/{seo_textdata_type}/type'  requirements:    _permission: 'view published text data entities'seo_textdata.import:  path: '/admin/seo_textdata/{seo_textdata_type}/import'  defaults:    _form: 'Drupal\seo_textdata\Form\TextDataImportForm'    _title_callback: '\Drupal\seo_textdata\Controller\TextdataController::getTitle'  requirements:    _permission: 'add text data entities'seo_textdata.file_preview:  path: '/admin/seo_textdata/{seo_textdata}/preview'  defaults:    _form: 'Drupal\seo_textdata\Form\TextdataFilePreview'    _title: '预览'  requirements:    _permission: 'add text data entities'  options:    parameters:      seo_textdata:        type: entity:seo_textdataseo_textdata.force_download:  path: '/admin/seo_textdata/{seo_textdata}/download/file'  defaults:    _controller: 'Drupal\seo_textdata\Controller\TextdataController::downloadFile'    _title: '下载'  requirements:    _permission: 'add text data entities'  options:    parameters:      seo_textdata:        type: entity:seo_textdata